int solve(int value)
{
    if (value < sizeof(fastResult) / sizeof(fastResult[0]))
    {
        return fastResult[value];
    }

    int result = 0;
    for (int start = 0; start < maxDataCount; ++start)
    {
        for (int end = start + 1; end < maxDataCount; ++end)
        {
            int sub = dataSum[end] - dataSum[start];
            if (value == sub)
            {
                ++result;
                break;
            }
            else if (value < sub)
            {
                break;
            }
        }
    }

    return result;
}

